import React from "react";
import Link from "next/link";
import {
  Container,
  Text,
  SubHeader,
  Input,
  PrimaryButton,
  SubText,
  ActionButton,
  CaptionText
} from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  flex: 0.3;
  padding-top: 50px;
  padding-left: 60px;
  padding-right: 10px;

  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
`;
const FormWrapper = styled(Container)`
  flex-direction: column;
  flex: 0.7;
  min-height: 100%;
  max-height: 100%;
`;
const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding-top: 60px;
  padding-left: 50px;
  padding-right: 50px;
  /* padding-bottom: 0px; */
  justify-content: center;
  flex: 1;
  /* background-color: red; */
`;

const Login = () => {
  return (
    <Container
      flex={1}
      color="red"
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <FormWrapper>
        <Form>
          <SubHeader customStyles={{ fontWeight: "500", marginBottom: 10 }}>
            Login
          </SubHeader>
          <Text>Welcome back, log in to see the latest data!</Text>
          <fieldset
            style={{
              display: "flex",
              paddingTop: "30px",
              paddingLeft: 0,
              paddingRight: 0,
              paddingBottom: 0,
              border: "none",
              flexDirection: "column"
            }}
          >
            <Input label="EMAIL" placeholder="eg: name@example.com" />
            <Input type="password" label="PASSWORD" />
          </fieldset>
          <Container row left center customStyles={{ marginBottom: 15 }}>
            <ActionButton
              onClick={() => {
                console.log("hey");
              }}
            >
              Forgot our password?
            </ActionButton>
          </Container>

          <PrimaryButton type="submit">Login</PrimaryButton>
          <Container row middle center customStyles={{ marginTop: 40 }}>
            <Link href={"/Landlrd/signup"} as={"landlord/register"}>
              <a>
                <SubText
                  customStyles={{
                    fontWeight: "italic",
                    color: "#0078D4"
                  }}
                >
                  New to House-Assist Space? Register
                </SubText>
              </a>
            </Link>
          </Container>
        </Form>
      </FormWrapper>
      <ImgWrapper>
        <Container flex={false} row center color="transparent">
          <img
            src={hasLogo}
            style={{ width: "50px", height: "50px", marginRight: "10px" }}
          />
          <Text customStyles={{ color: "white" }}>House-Assist Space</Text>
        </Container>
      </ImgWrapper>
    </Container>
  );
};

export default Login;
